import React from "react";
import { LoadingSpinner, Player, ControlBar } from "video-react";
import "../../../node_modules/video-react/dist/video-react.css";
import Helmet from "react-helmet";
import { render } from "react-dom";

export default Watch => {
  const style = {
    marginTop: "400px"
  };
  const float = {
    float: "left",
    marginTop: "50px"
  };
  return (
    <div style={style}>
      <div style={float}>
        {/* <Helmet bodyAttributes={{ style: "background-color: black" }} /> */}
        <Player
          style={float}
          playsInline
          fluid={false}
          width={500}
          height={250}
          poster="../../images/bluehour.png"
          src="https://song-253.s3.amazonaws.com/video/BlueHour.mp4"
        >
          <LoadingSpinner />
          <ControlBar width={500} />
        </Player>
      </div>
      <div style={float}>
        <Player
          style={float}
          playsInline
          fluid={false}
          width={500}
          height={250}
          poster="/assets/poster.png"
          src="https://song-253.s3.amazonaws.com/video/GracefulShadows.mp4"
        >
          <LoadingSpinner />
          <ControlBar width={500} />
        </Player>
      </div>
    </div>
  );
};
